import './Home.css';
import MyNavbar from '../../components/Navbar/Navbar';
import { Col, Container, Row } from 'react-bootstrap';
function Home(){
return(
   <>
    <MyNavbar/>
   <Container>
      <Row>
         <Col lg={6}>
            <h1>برنامه نویسی با نکست ان کد</h1>
         </Col>
         <Col></Col>
      </Row>
   </Container>
   </>
)
}
export default Home
